static void sensor_init(void)
{
	LOG_INF("+");

	table_write_cmos_sensor(sensor_init_setting_array1,
		sizeof(sensor_init_setting_array1) / sizeof(kal_uint16));
	mdelay(35);
	table_write_cmos_sensor(sensor_init_setting_array2,
		sizeof(sensor_init_setting_array2) / sizeof(kal_uint16));

	load_s5khm6sp_awb();

	LOG_INF("-");
}

static void preview_setting(void)
{
	LOG_INF("+");
	sensor_init();	

	table_write_cmos_sensor(preview_setting_array,
		sizeof(preview_setting_array) / sizeof(kal_uint16));
	LOG_INF("-");
}				

