static kal_uint32 get_default_framerate_by_scenario(enum MSDK_SCENARIO_ID_ENUM scenario_id, MUINT32 *framerate)
{
	LOG_INF("scenario_id = %d\n", scenario_id);

	switch (scenario_id)
	{
	case MSDK_SCENARIO_ID_CAMERA_PREVIEW:
		*framerate = imgsensor_info.pre.max_framerate;
		break;
	case MSDK_SCENARIO_ID_VIDEO_PREVIEW:
		*framerate = imgsensor_info.normal_video.max_framerate;
		break;
	case MSDK_SCENARIO_ID_CAMERA_CAPTURE_JPEG:
		*framerate = imgsensor_info.cap.max_framerate;
		break;
	case MSDK_SCENARIO_ID_HIGH_SPEED_VIDEO:
		*framerate = imgsensor_info.hs_video.max_framerate;
		break;
	case MSDK_SCENARIO_ID_SLIM_VIDEO:
		*framerate = imgsensor_info.slim_video.max_framerate;
		break;
	case MSDK_SCENARIO_ID_CUSTOM1:
		*framerate = imgsensor_info.custom1.max_framerate;
		break;
	case MSDK_SCENARIO_ID_CUSTOM2:
		*framerate = imgsensor_info.custom2.max_framerate;
		break;
	case MSDK_SCENARIO_ID_CUSTOM3:
		*framerate = imgsensor_info.custom3.max_framerate;
		break;
	case MSDK_SCENARIO_ID_CUSTOM4:
		*framerate = imgsensor_info.custom4.max_framerate;
		break;
	case MSDK_SCENARIO_ID_CUSTOM5:
		*framerate = imgsensor_info.custom5.max_framerate;
		break;
	default:
		break;
	}

	return ERROR_NONE;
}


static kal_uint32 set_test_pattern_mode(kal_uint8 modes, struct SET_SENSOR_PATTERN_SOLID_COLOR *pTestpatterndata)
{

 	kal_uint32 Color_R, Color_Gr, Color_Gb, Color_B;

	if (modes){
		write_cmos_sensor(0x0600, 0x0001);
		if(modes == 1 && (pTestpatterndata != NULL)) { //Solid Color
			Color_R  = pTestpatterndata->COLOR_R; 
			Color_Gr = pTestpatterndata->COLOR_Gr;
			Color_B  = pTestpatterndata->COLOR_B;
			Color_Gb = pTestpatterndata->COLOR_Gb;
			write_cmos_sensor(0x0602, (Color_Gr >> 0) );
			write_cmos_sensor(0x0604, (Color_B >> 0) );
			write_cmos_sensor(0x0606, (Color_R >> 0) );
			write_cmos_sensor(0x0608, (Color_Gb >> 0) );


		}

	} else {/*No pattern*/
        	 write_cmos_sensor(0x0600, 0x0000);
	}

	spin_lock(&imgsensor_drv_lock);

	imgsensor.test_pattern = modes;

	spin_unlock(&imgsensor_drv_lock);

	return ERROR_NONE;

}

